package anonymousTask;

public class CalcResult {
	private int sumResult;
	private int mulesult;
	private int subresult;
	private int divResult;
	
	public CalcResult() {
		// TODO Auto-generated constructor stub
	}

	public CalcResult(int sumResult, int mulesult, int subresult, int divResult) {
		super();
		this.sumResult = sumResult;
		this.mulesult = mulesult;
		this.subresult = subresult;
		this.divResult = divResult;
	}

	public int getSumResult() {
		return sumResult;
	}

	public void setSumResult(int sumResult) {
		this.sumResult = sumResult;
	}

	public int getMulesult() {
		return mulesult;
	}

	public void setMulesult(int mulesult) {
		this.mulesult = mulesult;
	}

	public int getSubresult() {
		return subresult;
	}

	public void setSubresult(int subresult) {
		this.subresult = subresult;
	}

	public int getDivResult() {
		return divResult;
	}

	public void setDivResult(int divResult) {
		this.divResult = divResult;
	}
	
	
	
	
}
